import Link from 'next/link';

const LandingPage = () => (
    <div>
        <Link href="/dealer">
            <a>Dealer</a>
        </Link>
        <Link href="/customer">
            <a>Customer</a>
        </Link>
        <style jsx>{`
            .team {
                width:100%;
                height:100%;
                position:absolute;
                background: url('../public/background.png') no-repeat;
            }
        `}</style>
    </div>
);

export default LandingPage;
